import React from 'react';

class SelectionPanel extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div onClick={() => this.props.onAddItem("Square")}>
        <p>Square</p>
      </div>
    );
  }
}

export default SelectionPanel;
